import { memo, useCallback, useEffect, useState } from 'react'
import { Table, DatePicker } from 'antd';
import type { ColumnsType } from 'antd/es/table';
import moment from 'moment';
// import one from '../assets/pic/one.png';
// import two from '../assets/pic/two.png';
// import three from '../assets/pic/three.png';
import { useSelector } from 'react-redux';
import type { StateType, } from '@/store';
import type { ShiningPoolDatasType, ShiningPoolDataType } from '@/store/app';
import { useShowDrawer } from '@/hook/public';

interface IProps {
}

interface DataType {
  key: number;
  rank: number;
  author: string;
  like: number;
  reward: number;
  account: string;
}

const RewardRank: React.FC<IProps> = (props) => {
  // const yesterday: string = moment().subtract(1, 'days').format('YYYY-MM-DD');
  const [defaultValue, setDefaultValue] = useState<moment.Moment>(moment().subtract(1, 'days'));
  const [dataSource, setDataSource] = useState<DataType[]>([]);
  const handleShowDrawer = useShowDrawer();
  const profiles = useSelector<StateType, {[index: string]: string}>((state: StateType) => state.app.profiles);
  const shiningPoolDatas = useSelector<StateType, ShiningPoolDatasType>((state: StateType) => state.app.shiningPoolDatas);
  const dfsPrice = useSelector<StateType, {DFS: number, USD: number, CNY: number}>((state: StateType) => state.app.dfsPrice);
  const priceOption = useSelector<StateType, 'DFS'|'USD'|'CNY'>((state: StateType) => state.app.priceOption);
  const idMapAccount = useSelector<StateType, {[index: string]: string}>((state: StateType) => state.app.idMapAccount);
  
  const columns: ColumnsType<DataType> = [
    {
      title: <span className="fw-bold">排名</span>,
      dataIndex: 'rank',
      key: 'rank',
      align: 'center',
      render: (text, record, index) => {
        if (text === 1) {
          return <img width="40px" height="30px" src='data:image/png;base64,' alt="one"/>
        } else if (text === 2) {
          return <img width="40px" height="30px" src="data:image/png;base64," alt="two"/>
        } else if (text === 3) {
          return <img width="40px" height="30px" src="data:image/png;base64," alt="three"/>
        } else {
          return text;
        }
      }
    },
    {
      title: <span className="fw-bold">作者</span>,
      dataIndex: 'author',
      key: 'author',
      align: 'center',
      // width: "45%",
      render: (text: string, record, index) => {
        return <span style={{color: '#1890ff'}} className="hover-pointer" onClick={() => handleShowDrawer(record.account)}>{text}</span>
      }
    },
    {
      title: <span className="fw-bold">奖励({priceOption})</span>,
      dataIndex: 'reward',
      key: 'reward',
      align: 'center',
      // width: "25%"
    },
    {
      title: <span className="fw-bold">获赞数量</span>,
      dataIndex: 'like',
      key: 'like',
      align: 'center',
      // width: "30%"
    },
  ];

  const handleShowName = useCallback((nick: string, account: string): string => {
    // return (nick? nick: '') + (showAccount? '@' + account : '@******');
    if (typeof nick === 'undefined' || nick.trim() === '') {
      return account;
    } else {
      return nick;
    }
  }, []);

  const handleRewardData = useCallback((date: string) => {
    if (!Object.keys(shiningPoolDatas).length) {//判断对象是否为空
      return;
    }
    const profilesTmp: {[index: string]: string} = profiles;
    const dataArray: DataType[] = [];
    // const shiningPoolData = Array.from(shiningPoolDatas[date].author_map);
    date = moment(date).diff('2022-10-30', 'days').toString();
    const shiningPoolData = Object.entries((shiningPoolDatas[date] as ShiningPoolDataType).author);
    shiningPoolData.sort((a, b) => {
      return b[1].reward - a[1].reward;
    });
    let rank: number = 1;
    shiningPoolData.forEach(item => {
      const idAccount = idMapAccount[item[0]];
      const nick = profilesTmp[idAccount] as string;
      dataArray.push({ key: rank, rank: rank++, author: handleShowName(nick, idAccount), like: item[1].like, reward: Number((item[1].reward * dfsPrice[priceOption]).toFixed(4)), account: idAccount});
    });
    setDataSource(dataArray);

  }, [shiningPoolDatas, profiles, dfsPrice, priceOption, handleShowName, idMapAccount]);

  const handleDateChange = useCallback((date: any, dateString: any) => {
    setDefaultValue(date);
    handleRewardData(dateString);
  },[handleRewardData]);

  useEffect(() => {
    handleRewardData(defaultValue.format('YYYY-MM-DD'));
  },[handleRewardData, defaultValue]);


  return (
    <div style={{position: 'relative'}}>
      <Table size="small" dataSource={dataSource} columns={columns} rowClassName={(record, index) => {
        if (record.rank === 1) {
          return 'bg-gold'
        } else if (record.rank === 2) {
          return 'bg-silver'
        } else if (record.rank === 3) {
          return 'bg-copper'
        } else {
          return ''
        }
      }}/>
      <DatePicker style={{position: 'absolute', bottom: '11px'}} defaultValue={defaultValue} onChange={handleDateChange} />
    </div>
  )
};

export default memo(RewardRank);
